import React from "react";
import Carousel from "./components/carousel";
import CarouselItem from "./components/carouselItem";

const App: React.FC = () => {
  return (
    <Carousel>
      <CarouselItem>
        <img src="path/to/image1.jpg" alt="Character 1" />
      </CarouselItem>
      <CarouselItem>
        <img src="path/to/image2.jpg" alt="Character 2" />
      </CarouselItem>
      <CarouselItem>
        <img src="path/to/image3.jpg" alt="Character 3" />
      </CarouselItem>
      {/* Add more CarouselItem components as needed */}
    </Carousel>
  );
};

export default App;
